import React from 'react'
import { useSelector } from 'react-redux'

const Users = () => {
  const users = useSelector(store => store.user)

  return(
    <div>
      <h2>Users</h2>
      {users.length === 0 ?
        <div/>
        :
        <table>
          <tr>
            <thead></thead>
            <thead>blogs</thead>
            <thead>created</thead>
          </tr>
          {users.map((user) =>
            <div key={user.id}>
              {user.username} {user.blogs.length}
            </div>
          )}
        </table>
      }
    </div>
  )
}

export default Users
